def testEncoder(RLEEncoder):
	testsNum = len(tests)
	successNum = 0

	print("Testing RLE encoder...")
	for i in range(testsNum):
		print("Test", i+1, ">>> ", end="")
		res = None
		try:
			res = (RLEEncoder(tests[i][0]) == tests[i][1])
		except Exception as e:
			print("RUNTIME ERROR:", e)
		if res == True:
			print("OK")
			successNum += 1
		elif res == False:
			print("WRONG ANSWER")

	print()
	print("Sucсeed:", successNum, "out of", testsNum)
	print("Failed:", testsNum - successNum, "out of", testsNum)
	if testsNum == successNum:
		print("ALL TESTS PASSED")

	return 


